La justice est un principe philosophique, juridique et moral fondamental : suivant ce principe, les actions humaines doivent être approuvées ou rejetées en fonction de leur mérite au regard de la morale (le bien), du droit, de la vertu ou de toute autre norme de jugement des comportements. La justice, principe à portée universelle, connaît des variations suivant les cultures. La justice est un idéal souvent jugé fondamental pour la vie sociale et la civilisation. Au sein d'un État, la justice est un ensemble d’institutions (police, tribunaux, prisons…) qui imposent le règne de la loi, sans lien nécessaire avec le principe philosophique. Elle est jugée fondamentale pour faire respecter les lois de l’autorité en place, légitime ou pas. La justice est censée punir quiconque ne respecte pas la loi avec une sanction ayant pour but de lui apprendre la loi et parfois de contribuer à la réparation des torts faits à autrui, au patrimoine privé ou commun ou à l'environnement. Pour des raisons de clarté, cet article traite séparément de la justice dans ses trois acceptions : 
* la justice au sens philosophique d'idéal individuel ou collectif ; 
* la justice comme norme émanant d'une société ou d'un corps d'autorité ; 
* la justice comme institution caractéristique des sociétés fondées sur la loi.
